import { useState } from "react";
import style from "./Form.module.css";

const Form = () => {
    const [form, setForm] = useState({ usernam: "", password: "" });
    
    const handleChange = (event) => { //recibe el evento y asi modificamos el estado
        if (event.target.username) {
            setForm({})
        }
    }

  return (
    <form className={style.Container}>
      <h1 className={style.Title}> Iniciar Sesion</h1>
      <div>
        <label className={style.User} htmlFor="username">
          Username:
        </label>
        <input
          className={style.Input1}
          type="text"
          name="username"
          value={form.username} //para que lo ingresado modifique el estado
          onChange={handleChange} // para poder modificar el estado.
        />
      </div>
      <div>
        <label className={style.Pass} htmlFor="password">
          Password:
        </label>
        <input
          className={style.Input2}
          type="text"
          name="password"
          value={form.password}
          onChange={handleChange}
        />
      </div>
      <button className={style.Boton} type="submit">
        Login
      </button>
    </form>
  );
};

export default Form;
